import './App.css';
import React from 'react'
import styles from './App.css';
import logo from '../pictures/Arcachon.jpg'

class City_illustration extends React.Component{
    render(){
        return(
            <div className= "wrapper_2">
                <h1>test </h1>
                <div class = {styles.Paris_pic}>
                    <img src={logo} width="50" height="60" />
                </div>
            </div>
        )
    }
}

export default City_illustration;
